	import SynchronousCommand from "../../ace/SynchronousCommand";
	import Event from "../../ace/Event";
	import ToggleScheduleCardSelectionAction from "../../../src/box/actions/ToggleScheduleCardSelectionAction";
	import * as AppUtils from "../../../src/AppUtils";
	import * as AppState from "../../../src/AppState";
	
	export default class AbstractSelectScheduleCardRangeCommand extends SynchronousCommand {
	    constructor() {
	        super("box.SelectScheduleCardRangeCommand");
	    }
	
	    initCommandData(data) {
	        data.selectedCardIds = AppState.get(
	        	["rootContainer", "mainView", "allActiveCardsView", "selectedCardIds"]
	        )
	        ;
	        data.activeCardList = AppState.get(
	        	["rootContainer", "mainView", "allActiveCardsView", "activeCardList"]
	        )
	        ;
	        data.outcomes = [];
	    }

		addOkOutcome(data) {
			data.outcomes.push("ok");
		}
		addNoSelectionOutcome(data) {
			data.outcomes.push("noSelection");
		}
		
		publishEvents(data) {
			const events = [];
			const actionsToBeTriggered = [];
			if (data.outcomes.includes("ok")) {
				events.push(new Event('box.SelectScheduleCardRangeOkEvent'));
			}
			if (data.outcomes.includes("noSelection")) {
				events.push(new Event('box.SelectScheduleCardRangeNoSelectionEvent'));
				actionsToBeTriggered.push(
					{
						action: new ToggleScheduleCardSelectionAction(), 
						data: {
							cardId: data.cardId
						}
					}
				);
			}
			
			this.publish(events, data);
		  	AppState.stateUpdated();
			this.trigger(actionsToBeTriggered);
	
		}

	}
	
	
	
